import React, { Component } from 'react';

// core components
import {
    chartOptions,
    parseOptions,
    chartExample1,
    chartExample2
  } from "../variables/charts.jsx";

export default class reports extends Component {
    render() {
        return (
            <div>
                <div className="chart">
                    <Bar
                      data={chartExample2.data}
                      options={chartExample2.options}
                    />
                  </div>
            </div>
        )
    }
}
